  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains data from the Department
  of Budget and Management as part of the Managing for Results (MFR) program. DBM
  collects these data for each state agency. The MFR data are published to the Open
  Data Portal by the Department of Information Technology (DoIT). This dataset contains
  only the data for the Maryland State Department of Education's Objective 1.1: 'By
  2016-2017, the percentage of non-proficient students in English/language arts and
  mathematics on State Assessments will be reduced from baseline data which will be
  established following the 2014-15 administration of the new PARCC assessments.'
  This objective falls under MSDE's Goal 1: 'Achievement will improve for each student.'
